import base64

str ='nimda'
strbyte = str.encode('UTF-8')
for i in range(20):
    strbyte = base64.b64encode(strbyte)

res = strbyte.decode('ascii')
res = res.replace('1','!')
res = res.replace('2','@')
res = res.replace('3','$')
res = res.replace('4','^')
res = res.replace('5','&')
res = res.replace('6','*')
res = res.replace('7','(')
res = res.replace('8',')')
print(res)

